  FaCaretUp,
  FaCaretLeft,
  FaCaretRight,
} from "react-icons/fa";
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";

const WrapperBack = () => {
  return (
    <div className="div-wrapper">
      <div id="bg" className="outer-wrap back">
        <TransformWrapper>
        <div className="card-wrapper back">
          <img className="pic" src={`./shoes/1.jpg`} />
